import React, { Component } from "react";
import TripServices from "../services/TripServices";

class MatchTrips extends Component {
  constructor(props) {
    super(props);

    this.state = {
      tripId: this.props.match.params.id,
      //tripId: "4",
    };
  }

  componentDidMount() {
    let tripList = TripServices.GetmatchTrip(this.state.tripId);
    console.log(tripList);
  }
  render() {
    return <div>"lund"</div>;
  }
}

export default new MatchTrips();
